	//FORMS
	//select
	
	function Select(config) {
		var select = config.item,
			optionValue = [],
			optionText = [],
			selectOption = select.find('option'),
			selectPlaceholder = config.placeholder || '',
			selectBlock = null,
			selectText = null,
			selectList = null;
	
		var build = {
			init: function() {
				this._createHtml();
				this._openSelect();
				this._setCurrentOption();
				this._closeSelectOnBody();
			},
			_getOption: function() {
				selectOption.each(function() {
					var that = $(this);
	
					optionValue.push(that.val());
					optionText.push(that.text());
				});
			},
			_createHtml: function() {
	
				this._getOption();
	
				select.wrap('<div class="my-select"></div>'); //create wrapper
	
				selectBlock = select.parents('.my-select');
	
				selectBlock.append('<div class="my-select__text"></div>'); //create text block in the wrapper
				selectBlock.append('<ul class="my-select__list"></ul>'); //create list in the wrapper
				selectBlock.append('<i></i>'); //create icon in the wrapper
	
				selectList = select.siblings('.my-select__list');
				selectText = select.siblings('.my-select__text');
	
				//add a placeholder if it exists
				if (selectPlaceholder.length != 0) {
					select.siblings('.my-select__text').addClass('is-placeholder').text(selectPlaceholder);
				} else {
					select.siblings('.my-select__text').text(optionText[0]);
				};
	
				//create list items
				for (var i = 0; i < optionValue.length; i++) {
					selectList.append('<li data-value="' + optionValue[i] + '">' + optionText[i] + '</li>');
				};
	
				if (selectPlaceholder.length == 0) {
					selectList.find('li').eq(0).addClass('is-active');
				};
			},
			_closeAllSelects: function() {
				$('.my-select').removeClass('is-open');
				$('.my-select__list').removeClass('is-open');
				$('.js-color').removeClass('is-open');
			},
			_closeSelect: function() {
				select.parents('.my-select').removeClass('is-open');
				select.siblings('.my-select__list').removeClass('is-open');
			},
			_openSelect: function() {
				var that = this;
	
				selectText.click(function(event) {
					if (selectBlock.hasClass('is-open')) {
						that._closeSelect();
					} else {
						that._closeAllSelects();
						selectBlock.addClass('is-open');
						selectList.addClass('is-open');
					};
					event.stopPropagation();
				});
			},
			_setCurrentOption: function() {
				var that = this;
	
				selectList.find('li').click(function(event) {
					var currText = $(this).text(),
						currValue = $(this).data('value').toString();
	
					selectList.find('li').removeClass('is-active');
					$(this).addClass('is-active');
	
					that._closeAllSelects();
					select.find('option').each(function() {
						if ($(this).val() === currValue) {
							$(this).prop('selected', true);
						} else {
							$(this).prop('selected', false);
						};
					});
					select.trigger('change');
					event.stopPropagation();
				});
	
				select.change(function() {
					var currText= $(this).find('option:selected').text(),
						currValue = $(this).find('option:selected').val();
	
					selectText.text(currText).removeClass('is-placeholder');
	
					selectList.find('li').removeClass('is-active');
					selectList.find('li[data-value="' + currValue + '"]').addClass('is-active');
				});
			},
			_closeSelectOnBody: function() {
				var that = this;
	
				body.click(function() {
					that._closeAllSelects();
				});
			}
		};
		build.init();
	};
	
	$('.js-select').each(function() {
		new Select({
			item: $(this),
			placeholder: $(this).attr('placeholder')
		});
	});
	
	//dropdown like a select
	function Dropdown(options) {
		var config = options || {},
			dropdown = config.item,
			dropdownText = dropdown.find('.js-dropdown-text'),
			dropdownList = dropdown.find('.js-dropdown-list'),
			dropdownItem = dropdown.find('.js-dropdown-list li'),
			that = this;
	
		this._openDD = function() {
			dropdownText.click(function() {
				if (dropdown.hasClass('is-active')) {
					that._closeDD();
				} else {
					that._closeDD();
					dropdown.addClass('is-active');
				};
				return false;
			});
		},
		this._closeDD = function() {
			$('.js-dropdown').removeClass('is-active');
		},
		this._closeOnBody = function() {
			body.click(function() {
				that._closeDD();
			});
		},
		this._changeValue = function() {
			dropdownItem.click(function() {
				dropdownItem.removeClass('is-active');
				$(this).addClass('is-active');
				dropdown.removeClass('is-active');
				dropdownText.text($(this).text());
				return false;
			});
		},
		this.init = function() {
			that._openDD();
			that._closeOnBody();
			that._changeValue();
		}
	
		this.init();
	
	};
	
	$('.js-dropdown').each(function() {
		new Dropdown({
			item: $(this)
		});
	});

	(function() {

	

		var parentClass = 'js-choose-colors';

			chooseColorsModal = $('.' + parentClass);

	

		function ChooseColors(parent) {

	

			this._parent = parent;

			this._form = this._parent.find('.' + parentClass + '-form');

			this._section = this._parent.find('.' + parentClass + '-section');

	

			this._modal = this._parent.find('.' + parentClass + '-modal');

			this._preview = this._parent.find('.' + parentClass + '-preview');

			this._heading = this._parent.find('.' + parentClass + '-heading');

			this._description = this._parent.find('.' + parentClass + '-description');

			this._close = this._parent.find('.' + parentClass + '-close');

	

			this._select = $('.' + parentClass + '-select');

			this._selectText = this._select.find('.' + parentClass + '-text');

	

	

			this._iconName = '.' + parentClass + '-icon';

			this._inputName = '.' + parentClass + '-input';

	

			this._itemName = '.' + parentClass + '-item';

	

			this._imgName = '.' + parentClass + '-img';

			this._infoName = '.' + parentClass + '-info';

	

			this._active = 'is-active';

	

			this._formSubmit();

			this._setActive();

			this._showFullInfo();

			this._closeModalOnClick();

	

			this._parent.on('hide.bs.modal', function() {

				this._closeModal();

			}.bind(this));

		}

	

		ChooseColors.prototype._formSubmit = function() {

	

			this._form.on('submit', function(e) {

				e.preventDefault();

	

				this._setActive();

			}.bind(this));

	

		};

	

		ChooseColors.prototype._setActive = function() {

	

			var current = this._getActive();

			var currentValue = current.value;

			var currentIcon = current.icon;

	

			//remove old icon

			this._select.find('i').remove();

			//set new icon

			this._selectText.before(currentIcon);

			//set current text

			this._selectText.text(currentValue);

			//close modal

			this._parent.modal('hide');

	

		};

	

		ChooseColors.prototype._getActive = function() {

			var that = this;

			var current = {

				value: [],

				icon: null

			};

	

			this._section.find(this._inputName).each(function() {

				var _this = $(this),

					icon = _this.siblings(that._iconName);

	

				if (_this.prop('checked')) {

					current.value.push($(this).data('value'));

					//find current icon

					if (icon.length) {

						//get clone and remove class

						current.icon = icon.clone().removeAttr('class');

					}

				}

	

			});

	

			if (this._section.length > 1) {

				current.value = current.value.join('/');

			} else {

				current.value = current.value.join();

			}

	

			return current;

	

		};

	

		ChooseColors.prototype._showModal = function(config) {

			this._modal.addClass(this._active);

	

			this._preview.css('background-image', 'url("' + config.img +'")');

			this._heading.text(config.heading);

			this._description.text(config.description);

		};

	

		ChooseColors.prototype._closeModal = function() {

			this._modal.removeClass(this._active);

		};

	

		ChooseColors.prototype._showFullInfo = function() {

			var that = this;

			$(this._inputName).on('change', function() {

				var _this = $(this);

				if (_this.prop('checked') == true) {

					var	parent = _this.parents(that._itemName);

	

					console.log(parent.find(that._imgName).data('img'));

	

					that._showModal({

						img: parent.find(that._imgName).data('img'),

						heading: _this.data('value'),

						description: parent.find(that._infoName).text()

					});

				}

			});

		};

	

		ChooseColors.prototype._closeModalOnClick = function() {

			this._close.click(function(e) {

				e.preventDefault();

				this._closeModal();

			}.bind(this));

		};

	

		chooseColorsModal.each(function() {

			new ChooseColors($(this));

		});

	

	})();

	//range slider

	var range = $('.js-range');

	

	function rangeSlider(config) {

		var item = config.item;

		var rangeInput = item.find('.js-range-input');

		var rangeFrom = item.find('.js-range-from');

		var rangeTo = item.find('.js-range-to');

	

		var startValue = +rangeFrom.val();

		var startEnd = +rangeTo.val();

		var values = [startValue, startEnd];

	

		var min = rangeInput.data('min');

		var max = rangeInput.data('max');

	

		rangeInput.slider({

			range: true,

			tooltip: 'hide',

			value: values,

			min: min,

			max: max

		});

	

		// rangeInput.on('slide', function(el) {

		// 	var valueFrom = el.value[0],

		// 		valueTo = el.value[1];

	

		// 	rangeFrom.val(valueFrom);

		// 	rangeTo.val(valueTo);

		// });

	

		rangeInput.on('change', function(e) {

			rangeFrom.val(e.value.newValue[0]);

			rangeTo.val(e.value.newValue[1]);

		});

	

		function inputChanges(newVal, num) {

			var currVal = Number(newVal);

	

			values[num] = currVal;

	

			console.log(values);

			rangeInput.slider('setAttribute', 'value', values);

			rangeInput.slider('refresh');

		}

	

		rangeFrom.keyup(function() {

			var currVal = $(this).val();

	

			inputChanges(currVal, 0);

		});

	

		rangeTo.keyup(function() {

			var currVal = $(this).val();

	

			inputChanges(currVal, 1);

		});

	}

	

	range.each(function() {

		new rangeSlider({

			item: $(this)

		});

	});

	

